import React, { Component } from "react";
import send from "../../img/send.svg";
import Privacidad from "../Privacidad/Privacidad";
import "./Contacto.css";

export default class Contacto extends Component {

  state ={
    estado : false,
    privacy : "PRIVACY POLICY"
  }

  change = () =>{
this.setState({estado : !this.state.estado})
if(this.state.estado)
this.setState({privacy : "x"})
else(this.setState({privacy : "PRIVACY POLICY"}))
  }
  render() {
    console.log(this.state.estado)
    return (
      <footer className="footer">
        <div className="letsTalk">
          <h1>¡Hablemos!</h1>
          <h2>Envíe su correo y le contactaré lo antes posible</h2>
          <form className="form">
            <input type="email" required></input>
            <button id="send">
              <img src={send} alt="enviar"></img>
            </button>
          </form>
        </div>
        <div className="menuFooter">
          <div className="tel">
            <h1>Escríbame</h1>
            <h2>(+57) 300 445 2451</h2>
          </div>
          <div className="line"></div>
          <div className="email">
            <h1>Envíeme un correo</h1>
            <h2>analieflorezs@gmail.com</h2>
          </div>

          <div className="line"></div>
          <div className="redesSociales">
            <h2>INSTAGRAM</h2>
            <h2>LINKEDIN</h2>
            <h2>GITHUB</h2>
          </div>

        </div>
        <h2 className={`${this.state.estado? 'cerrarPrivacidad' : 'privacidad'}`} onClick={this.change}>{this.state.privacy}</h2>
        <Privacidad estado={this.state.estado}></Privacidad>
      </footer>
    );
  }
}
